class App extends Component {
  state = {  }
  render() { 
    return ( 
      <div className='App'>
        <Header
        title='Veterinary Patient Manager'>
        </Header>
        <main>
          <NewAppointment></NewAppointment>
        </main>
      </div>
     );
  }
}

export default App;
